import React from 'react';

const PremiumLogo = props => {
  const { logoId = 'img', width, height } = props;

  return (
    <svg
      width={width}
      height={height}
      viewBox="0 0 87 87"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <rect width="87" height="87" fill={`url(#pattern-${logoId})`} />
      <defs>
        <pattern
          id={`pattern-${logoId}`}
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use xlinkHref={`#image-${logoId}`} transform="scale(0.00195312)" />
        </pattern>
        <image
          id={`image-${logoId}`}
          width="512"
          height="512"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
};

PremiumLogo.defaultProps = {
  width: 87,
  height: 87,
};

export default PremiumLogo;
